# [1209] Remove All Adjacent Duplicates in String II
#

from datetime import datetime 
time_start = datetime.now()

# @lc code=start
import re

class Solution:
    def removeDuplicates2(self, s: str, k: int) -> str:
        t = s
        t0 = ''
        m = re.compile(r'(.)\1{'+str(k-1)+'}')
        while t0 != t:
            t0 = t
            t = m.sub('', t)
        return t

    def removeDuplicates(self, s: str, k: int) -> str:
        st = [['', 0]]
        for c in s:
            if c == st[-1][0]:
                if st[-1][1]+1 == k:
                    st.pop()
                else:
                    st[-1][1] += 1
            else:
                st.append([c, 1])

        r = ''
        for c, n in st:
            r += c * n
        return r


